class FABSUser(AgencyUser):
    def __init__(self, name, agency):
        super().__init__(name, agency)

    def submit_fabs_data(self, data):
        # Submit FABS data
        print(f"Submitting FABS data for {self.name} from {self.agency}")
        # Validate data
        if self.validate_data(data):
            # Submit data
            super().submit_data(data)
        else:
            print("Data validation failed")

    def validate_data(self, data):
        # Validate FABS data
        # Check for required fields
        required_fields = ["ActionType", "ActionDate", "FederalActionObligation"]
        for field in required_fields:
            if field not in data:
                print(f"Missing required field: {field}")
                return False
        # Check for valid data types
        if not isinstance(data["ActionType"], str):
            print("Invalid data type for ActionType")
            return False
        if not isinstance(data["ActionDate"], str):
            print("Invalid data type for ActionDate")
            return False
        if not isinstance(data["FederalActionObligation"], float):
            print("Invalid data type for FederalActionObligation")
            return False
        return True


